Group Rules

@media 브라우저가 이 조건 만족 시 적용
@supports 브라우저가 이 기능 지원 시 적용
@document 페이지가 이 조건 만족 시 적용

참고로 이 규칙들은 쉼표를 사용하여 동시에 적용시킬 수 없음.
대신, 괄호 내 조건끼리 and or(,로 대체가능) not 으로 연결가능
사용 예시
@media (min-width : 800px) {
    background-color : "blue";
}

Transition
transform에 대한 시간, 속도 등을 설정

이 속성은 움직일 요소의 선택자에 직접 설정함.
transition-property 어느 속성에 적용할지 설정
property duration timing-function delay 묶어서 transition으로 사용함
시간 속성은 처음에 나오는게 무조건 duration 이 됨. 

Transform
transition을 통해 설정한 시간, 속도대로 실제 어떤 움직임을 사용할지 설정

이 속성은 움직일 행동 선택자에 설정해줌.
큰 따옴표를 사용하지 않는 함수를 값으로 가짐.

실습
transform-origin
기준점을 설정해줌.
0% 0%와 같은 백분위, left top과 같은 키워드만 사용가능.
Animation
대상 선택자에 속성을 설정하고, @keyframe을 통해 구체적인 행동을 설정

이 속성은 대상 요소의 선택자에 설정해줌.
animation-name은 반드시 첫번째 값으로 입력
처음으로 입력한 시간은 duration이 됨.

animation-direction

normal 행동 1회 종료 후 다시 제자리로 돌아온 뒤 재시작
reverse 종료 지점에서 시작하고, 진행 방향도 반대, 종료 후 종료 지점에서 재시작
alternate 홀수번째 시작은 normal 짝수번째 시작은 reverse
alternate-reverse 홀수번째 시작은 reverse 짝수번째 시작은 normal

실습
@keyframes
animation속성으로 시간 및 횟수를 설정했다면 진행 지점별 행동을 설정할 수 있음.
@keyframes animation-name {
    0% {
        0퍼센트에 할일
    }
    50% {
        50퍼센트에 할일
    }
    100% {
        100퍼센트에 할일
    }
}

만약 진행 지점이 0%와 100%밖에 없다면 from과 to를 사용할 수 있음.
@keyframes animation-name {
    from {
        0퍼센트에 할 일
    }
    to {
        100퍼센트에 할 일
    }
}

