Scope
var는 함수단위, let은 블록단위 스코프를 가짐
아래 코드는 2가 출력됨.
var a = 1;
if(true) {
    var a = 2;
}
console.log(a);

아래 코드는 1이 출력됨.
let b = 1;
if(true) {
    let b = 2;
}
console.log(b);

Argument, Parameter
함수의 길이는 매개변수의 수를, arguments의 길이는 인자의 수를 나타낸다.
let test = function (parm1, parm2, parm3) {
  console.log(`매개변수 개수 : ${test.length}`);
  console.log(`인자 개수 : ${arguments.length}`);
}

Context
다음과 같은 코드가 있다.
var name = 'zero'; // (1)변수 선언 (6)변수 대입
function wow(word) { // (2)변수 선언 (3)변수 대입
  console.log(word + ' ' + name); // (11)
}
function say () { // (4)변수 선언 (5)변수 대입
  var name = 'nero'; // (8)
  console.log(name); // (9)
  wow('hello'); // (10)
}
say(); // (7)

호이스팅으로 인해 함수 선언식으로 생성된 wow say 함수는 동째로 최상단으로 올려짐
컨텍스트의 모습은
전역컨텍스트: {
    변수객체:{
        arguments: null, 
        variable: [name,wow,say]
    }, 
    scopechain: [전역 변수객체], // 스코프체인은 자기자신과 상위 스코프의 변수객체임.
    this: window
}

'say컨텍스트' : {
    변수객체: {
        arguments: null,
        variable: ['name'],
    },
    scopeChain: ['say변수객체', '전역 변수객체'],
    this: window
}

'wow컨텍스트': {
    변수객체 : {
        arguments: [{word:'hello'}],
        variable: null,
    },
    scopechain: ['wow변수객체', '전역변수객체'],
    this: window
}
Closure
컨텍스트의 원리를 활용하면 클로져를 사용할 수 있음.
var makeClosure = function() {
    var name = 'zero';
    return function () {   
      console.log(name);
    }
  };
  var closure = makeClosure();

  closure();

위 코드의 컨텍스트는
"전역 컨텍스트": {
  변수객체: {
    arguments: null,
    variable: [{ makeClosure: Function }, 'closure'],
  },
  scopeChain: ['전역 변수객체'],
  this: window,
}

"makeClosure 컨텍스트": {
  변수객체: {
    arguments: null,
    variable: [{ name: 'zero' }],
  },
  scopeChain: ['makeClosure 변수객체', '전역 변수객체'],
  this: window,
}

"closure 컨텍스트":  {
  변수객체: {
    arguments: null,
    variable: null,
  scopeChain: ['closure 변수객체', 'makeClosure 변수객체', '전역 변수객체'],
  this: window,
}
makeClosure변수의 값은 익명함수가 된다. (반환값이 변수의 값이 되기 때문) 그래서 외부에서는 무슨 방법을 써도 name변수에 접근할 수 없음.
만약 makeClosure변수가 외부함수 없이 바로 익명함수를 저장한다면 makeClosure.name으로 접근이 가능함.

