        console.log("Hi jun");
    }
}

myObj.runTimeout();


위 코드의 콜백 함수는 Arrow function으로 선언되어 this는 myObj를 가리킨다.
this === window는 true를 출력한다.
this.printData()는 myObj.printData()를 의미하므로 해당 메시지가 정상적으로 출력된다.

