}

위 코드는 Student 클래스를 정의한 코드입니다.

외부에서 접근할 수 없는 String 변수인 name과 어디서든 접근할 수 있는 int 변수인 score를 가지고 있습니다.

생성자를 통해 이 클래스는 name과 score를 인자로 받아 클래스 내부에서 사용합니다.

getinfo 메서드를 호출하면 학생의 이름과 점수가 출력됩니다.

name 변수는 외부에서 직접 접근할 수 없지만, setName과 getName 메서드를 통해 값을 변경할 수 있고 반환받을 수도 있습니다.


package Score; 

public class Main { 
    public static void main(String[] args) { 
        Student st1 = new Student("Jun", 90); 
        Student st2 = new Student("Yul", 100); 

        st1.getinfo(); 
        st2.getinfo(); 

        st1.name = "JJ"; //여긴 private라 변경불가 
        st1.score = 100; 

        st1.setName("JJJ"); 

        System.out.println(st1.getName()); 
    } 
}

