st2 인스턴스는 "Yul" 이라는 이름과 100이라는 점수를 가지고 있습니다.

이후 getinfo 메서드를 호출하여 정보를 얻었습니다.

name 변수는 private변수이기때문에 st1.name 처럼 직접 접근할 수 없습니다.

이때 setName, getName 메서드를 통해 값을 설정하고 출력할 수 있습니다.

