StringBuffer, StringBuilder
package test; 

public class Hello { 
    public static void main(String[] args) { 
        String str = "JAVA"; 
        str = str+ "_8"; 

        StringBuffer sb = new StringBuffer("JAVA"); 
        sb.append("_8"); 

        StringBuilder sbuild = new StringBuilder("JAVA");
        sbuild.append("_8"); 
    } 
}


기존에 있던 문자열 str에 문자열을 추가하면 해당 메모리에 데이터가 추가되는것이 아니라 새로운 주소에 모두 합쳐진 데이터가 할당된다. 

그리고 기존 메모리 공간은 GC가 수거해간다. 사실 매우 비효율적이다.

이럴때 StringBuffer, StringBuilder 를 사용하면 그 자리에서 데이터를 추가할 수 있다.


StringBuffer
StringBuffer sb = new StringBuffer("JAVA"); 
sb.append("_8");

StringBuffer는 동기적으로 작동하기때문에 순차적으로 값이 들어오므로 데이터 안정성이 높다.
StringBuilder
StringBuilder sbuild = new StringBuilder("JAVA"); 
sbuild.append("_8");


StringBuilder는 비동기적으로 작동하기에 속도가 빠르지만 안정성이 떨어지는 단점이 있다.

물론 둘의 차이는 체감되는 정도가 아니지만, 최근엔 속도가 중요하기에 StringBuilder를 사용하는 추세임.


ArrayList
package test; 

import java.util.ArrayList; 

public class Hello { 
    public static void main(String[] args) { 
        ArrayList list = new ArrayList(); 

        list.add("Hello"); 
        list.add("JAVA"); 
        list.add("World"); 
        System.out.println(list); 

        list.add(1, "Welcome"); 
        System.out.println(list); 

        list.set(2, "Kotlin"); 
        System.out.println(list); 

        String newLanguage = list.get(2); 
        System.out.println(newLanguage); 

        list.remove(1); 
        System.out.println(list); 
    } 
}


ArrayList는 사이즈를 표기하지 않기에 크기가 유동적이다. 

그리고 인덱스를 통해 원하는 위치에 값을 추가, 변경, 추출, 제거를 할 수 있다.


